/*Table structure for table `system_role` */

DROP TABLE IF EXISTS `system_role`;

CREATE TABLE `system_role` (
  `role_id` varchar(32) NOT NULL COMMENT 'role_id',
  `role_name` varchar(60) DEFAULT NULL COMMENT '角色名称',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `add_userid` varchar(32) DEFAULT NULL,
  `add_date` datetime DEFAULT NULL,
  `modify_userid` varchar(32) DEFAULT NULL,
  `modify_date` datetime DEFAULT NULL,
  `record_flag` varchar(10) DEFAULT NULL,
  `system_id` varchar(300) DEFAULT NULL COMMENT '系统id',
  PRIMARY KEY (`role_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

