/*Table structure for table `system_user` */

DROP TABLE IF EXISTS `system_user`;

CREATE TABLE `system_user` (
  `user_id` varchar(32) NOT NULL COMMENT 'user_id',
  `user_code` varchar(20) DEFAULT NULL COMMENT '登录号',
  `user_name` varchar(60) DEFAULT NULL COMMENT '用户名称',
  `user_password` varchar(40) DEFAULT NULL COMMENT '密码',
  `user_sex` varchar(10) DEFAULT NULL COMMENT '性别',
  `user_salt` varchar(40) DEFAULT NULL COMMENT '密码salt',
  `dept_id` varchar(32) DEFAULT NULL COMMENT '部门id',
  `dept_code` varchar(20) DEFAULT NULL COMMENT '部门编号',
  `dept_name` varchar(60) DEFAULT NULL COMMENT '部门名称',
  `login_time` datetime DEFAULT NULL COMMENT '最近登录时间',
  `is_valid` varchar(10) DEFAULT NULL COMMENT '是否生效',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `login_ip` varchar(100) DEFAULT NULL COMMENT '限制登录ip',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `role_ids` varchar(400) DEFAULT NULL COMMENT '所属角色',
  `description` varchar(800) DEFAULT NULL COMMENT '个人描述',
  `user_img` varchar(200) DEFAULT NULL COMMENT '用户头像',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '新增人',
  `add_date` datetime DEFAULT NULL COMMENT '新增时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `modify_date` datetime DEFAULT NULL COMMENT '最后修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标记',
  `project_id` varchar(200) DEFAULT NULL COMMENT 'project_id',
  PRIMARY KEY (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

