/*Table structure for table `tool_api` */

DROP TABLE IF EXISTS `tool_api`;

CREATE TABLE `tool_api` (
  `api_id` varchar(32) NOT NULL DEFAULT '' COMMENT 'api_id',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `api_name` varchar(80) DEFAULT NULL COMMENT '接口名称',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `api_status` varchar(10) DEFAULT NULL COMMENT '状态',
  `api_type` varchar(10) DEFAULT NULL COMMENT 'api类型',
  `api_ip` varchar(40) DEFAULT NULL COMMENT '访问ip地址',
  `api_port` varchar(10) DEFAULT NULL COMMENT '端口',
  `is_longconnect` varchar(10) DEFAULT NULL COMMENT '长连接?',
  `receipt_message` varchar(400) DEFAULT NULL COMMENT '接收心跳报文',
  `sent_message` varchar(400) DEFAULT NULL COMMENT '回复心跳报文',
  `radio_second` int(11) DEFAULT NULL COMMENT '心跳频率(秒)',
  `max_num` int(11) DEFAULT NULL COMMENT '允许最大连接数',
  `allow_time` varchar(400) DEFAULT NULL COMMENT '允许访问时间范围',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`api_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='api工具表';

