/*Table structure for table `tool_dbsource` */

DROP TABLE IF EXISTS `tool_dbsource`;

CREATE TABLE `tool_dbsource` (
  `dbsource_id` varchar(32) NOT NULL COMMENT 'dbsource_id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `auditing` varchar(10) DEFAULT NULL COMMENT '状态',
  `dbsource_type` varchar(20) DEFAULT NULL COMMENT '数据源类型',
  `dbsource_name` varchar(20) DEFAULT NULL COMMENT '数据源名称',
  `db_driver` varchar(60) DEFAULT NULL COMMENT '驱动类',
  `jdbc_url` varchar(400) DEFAULT NULL COMMENT '连接串',
  `user_name` varchar(60) DEFAULT NULL COMMENT '用户名',
  `user_password` varchar(60) DEFAULT NULL COMMENT '密码',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '是否删除',
  `load_status` varchar(10) DEFAULT NULL COMMENT '已加载',
  PRIMARY KEY (`dbsource_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='数据源注册';

/*Data for the table `tool_dbsource` */

insert  into `tool_dbsource`(`dbsource_id`,`order_index`,`auditing`,`dbsource_type`,`dbsource_name`,`db_driver`,`jdbc_url`,`user_name`,`user_password`,`memo`,`add_userid`,`add_date`,`modify_userid`,`modify_date`,`record_flag`,`load_status`) values ('520386209048224027',5,'1','system','default','com.mysql.jdbc.Driver','jdbc:mysql://localhost:3306/duo','root','root','','admin','2019-12-17 14:21:57','admin','2019-12-18 08:12:42','0','1'),('520386209048225081',15,'1','system','platform','com.mysql.jdbc.Driver','jdbc:mysql://localhost:3306/duo','root','root','','admin','2019-12-18 08:11:42','admin','2019-12-18 08:12:42','0','1'),('569124896628662614',5,'1','system','eam','oracle.jdbc.OracleDriver','jdbc:oracle:thin:@127.0.0.1:1521:orcl','eam2020','eam','','admin','2020-01-19 11:20:58','admin','2020-01-19 11:21:05','0','1');

/*Table structure for table `tool_event` */

DROP TABLE IF EXISTS `tool_event`;

CREATE TABLE `tool_event` (
  `event_id` varchar(32) NOT NULL COMMENT 'event_id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `event_code` varchar(60) DEFAULT NULL COMMENT '事件编号',
  `event_name` varchar(60) DEFAULT NULL COMMENT '事件名',
  `page_type` varchar(60) DEFAULT NULL COMMENT '页面类型',
  `js_function` varchar(60) DEFAULT NULL COMMENT '前台方法',
  `bo_function` varchar(200) DEFAULT NULL COMMENT '后台方法',
  `forward_function` varchar(60) DEFAULT NULL COMMENT '响应方法',
  `permission_type` varchar(10) DEFAULT NULL COMMENT '权限类型',
  `is_show` varchar(10) DEFAULT NULL COMMENT '是否显示?',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标记',
  `ico_img` varchar(100) DEFAULT NULL COMMENT '事件图标',
  `default_disabled` varchar(10) DEFAULT NULL COMMENT '是否默认不可编辑',
  `selection_type` varchar(10) DEFAULT NULL COMMENT '多选，单选控制',
  PRIMARY KEY (`event_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

