/*Table structure for table `tool_excel_import` */

DROP TABLE IF EXISTS `tool_excel_import`;

CREATE TABLE `tool_excel_import` (
  `import_id` varchar(32) NOT NULL COMMENT 'import_id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `fun_id` varchar(32) DEFAULT NULL COMMENT 'fun_id',
  `fun_name` varchar(80) DEFAULT NULL COMMENT '功能名称',
  `auditing` varchar(10) DEFAULT NULL COMMENT '状态',
  `excel_template` varchar(80) DEFAULT NULL COMMENT 'excel模版',
  `head_index` int(11) DEFAULT NULL COMMENT '标题行号',
  `post_sql1` text COMMENT '导入后执行sql1',
  `post_sql2` text COMMENT '导入后执行sql2',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  `file_id` varchar(32) DEFAULT NULL COMMENT 'file_id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `post_detsql1` text COMMENT '逐条导入后执行sql1',
  `post_detsql2` text COMMENT '逐条导入后执行sql2',
  PRIMARY KEY (`import_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='excel数据导入';

