/*Table structure for table `tool_excel_import_column` */

DROP TABLE IF EXISTS `tool_excel_import_column`;

CREATE TABLE `tool_excel_import_column` (
  `column_id` varchar(32) NOT NULL COMMENT 'column_id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `column_name` varchar(80) DEFAULT NULL COMMENT '字段名称',
  `column_comment` varchar(80) DEFAULT NULL COMMENT '字段描述',
  `column_type` varchar(20) DEFAULT NULL COMMENT '字段类型',
  `col_index` varchar(10) DEFAULT NULL COMMENT '来源列号',
  `change_type` varchar(10) DEFAULT NULL COMMENT '转换类型',
  `control_name` varchar(10) DEFAULT NULL COMMENT '下拉控件名',
  `value_type` varchar(10) DEFAULT NULL COMMENT '取值方式',
  `default_value` varchar(80) DEFAULT NULL COMMENT '默认值',
  `is_null` varchar(10) DEFAULT NULL COMMENT '是否必填',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `import_id` varchar(32) DEFAULT NULL COMMENT 'import_id',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`column_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='excel数据导入字段明细';

