/*Table structure for table `tool_function_column` */

DROP TABLE IF EXISTS `tool_function_column`;

CREATE TABLE `tool_function_column` (
  `column_id` varchar(32) NOT NULL COMMENT 'column_id',
  `fun_id` varchar(32) DEFAULT NULL COMMENT 'fun_id',
  `group_name` varchar(10) DEFAULT NULL COMMENT '分组',
  `column_name` varchar(60) DEFAULT NULL COMMENT '字段编号',
  `column_statement` varchar(200) DEFAULT NULL COMMENT '字段语句',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `column_comment` varchar(80) DEFAULT NULL COMMENT '字段名称',
  `column_type` varchar(20) DEFAULT NULL COMMENT '字段类型',
  `auto_code` varchar(10) DEFAULT NULL COMMENT '自动编码?',
  `pre_code` varchar(10) DEFAULT NULL COMMENT '编码前缀',
  `code_length` int(11) DEFAULT NULL COMMENT '编码长度',
  `compute_sql` varchar(500) DEFAULT NULL COMMENT '编码计算公式',
  `is_addedit` varchar(10) DEFAULT NULL COMMENT '新增可编辑?',
  `is_modifyedit` varchar(10) DEFAULT NULL COMMENT '修改可编辑?',
  `is_null` varchar(10) DEFAULT NULL COMMENT '必填?',
  `is_unique` varchar(10) DEFAULT NULL COMMENT '唯一?',
  `unique_where` varchar(500) DEFAULT NULL COMMENT '唯一判断条件',
  `control_name` varchar(80) DEFAULT NULL COMMENT '控件名称',
  `default_value` varchar(80) DEFAULT NULL COMMENT '默认值',
  `display_style` varchar(60) DEFAULT NULL COMMENT '显示格式',
  `max_length` int(11) DEFAULT NULL COMMENT '最大字符长度',
  `blur_js` varchar(200) DEFAULT NULL COMMENT '鼠标离开触发',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `control_where` varchar(500) DEFAULT NULL COMMENT '控件参数-where',
  `control_source` varchar(500) DEFAULT NULL COMMENT '控件参数-源',
  `control_target` varchar(500) DEFAULT NULL COMMENT '控件参数-目标',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  `is_total` varchar(10) DEFAULT NULL COMMENT '自动汇总',
  `column_width` int(11) DEFAULT NULL COMMENT '字段宽度',
  `is_show` varchar(10) DEFAULT NULL COMMENT '是否Grid显示',
  PRIMARY KEY (`column_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

