/*Table structure for table `tool_function_event_sql` */

DROP TABLE IF EXISTS `tool_function_event_sql`;

CREATE TABLE `tool_function_event_sql` (
  `eventsql_id` varchar(32) NOT NULL COMMENT 'eventsql_id',
  `event_id` varchar(32) DEFAULT NULL COMMENT 'eventdet_id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `source_funid` varchar(32) DEFAULT NULL COMMENT '源funid',
  `target_funid` varchar(32) DEFAULT NULL COMMENT '目标funid',
  `event_type` varchar(10) DEFAULT NULL COMMENT '事件类型',
  `bo_function` varchar(800) DEFAULT NULL COMMENT '执行SQL/class',
  `source_sql` varchar(800) DEFAULT NULL COMMENT '源sql',
  `target_sql` varchar(800) DEFAULT NULL COMMENT '目标sql',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`eventsql_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

