ect 1 from system_role_user where role_id=#{importforeignKeyId} and user_id=#{user_id})','','admin','2019-10-31 11:12:30',NULL,NULL,'0'),('451213029146010281','451213029146010267',10,'system_role','system_user_role','import','','select role_id from system_role where role_id=#{sourceKeyId}','INSERT INTO system_role_user(det_id,user_id,role_id)  SELECT #{newKeyId},#{importforeignKeyId},#{role_id} from dual where not exists(select 1 from system_role_user where user_id=#{importforeignKeyId} and role_id=#{role_id})','','admin','2019-11-01 09:23:25',NULL,NULL,'0'),('520386209048225291','520386209048225276',1,'tool_system','tool_project_system','import','','select system_id,system_name from tool_system_module where system_id =#{sourceKeyId}','INSERT INTO tool_project_system(project_systemid,system_id,system_name,project_id,main_layout,order_index,is_show) VALUES(#{newKeyId},#{system_id},#{system_name},#{importforeignKeyId},\'main.index\',5,\'1\')','','admin','2019-12-18 08:25:48','admin','2019-12-18 08:35:23','0'),('521536057692717564','521536057692717364',5,'tool_function','tool_system_function','import','','SELECT fun_id,fun_name,ico_img,db_source,order_index FROM tool_function WHERE fun_id=#{sourceKeyId}','INSERT INTO tool_system_function (system_funid,system_id,fun_id,fun_name,order_index,ico_img,db_source,is_show,record_flag) VALUES(#{newKeyId},#{importforeignKeyId},#{fun_id},#{fun_name},#{order_index},#{ico_img},#{db_source},\'1\',\'0\')','','admin','2019-12-19 08:23:09','admin','2019-12-19 10:34:29','0');

/*Table structure for table `tool_function_query` */

