/*Table structure for table `tool_function_query_column` */

DROP TABLE IF EXISTS `tool_function_query_column`;

CREATE TABLE `tool_function_query_column` (
  `column_id` varchar(32) COLLATE utf8_bin NOT NULL COMMENT 'column_id',
  `query_id` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT 'query_id',
  `column_code` varchar(60) COLLATE utf8_bin DEFAULT NULL COMMENT '字段代号',
  `column_name` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '字段名称',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `column_type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '字段类型',
  `control_name` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '控件名称',
  `control_parames` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '控件参数',
  `place_holder` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '提示信息',
  `control_where` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '控件参数-where',
  `control_source` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '控件参数-源',
  `control_target` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '控件参数-目标',
  `add_userid` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '数据标识',
  `is_show` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '页面显示',
  PRIMARY KEY (`column_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

