/*Table structure for table `tool_table_index` */

DROP TABLE IF EXISTS `tool_table_index`;

CREATE TABLE `tool_table_index` (
  `index_id` varchar(32) NOT NULL COMMENT '主键id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `index_name` varchar(40) DEFAULT NULL COMMENT '索引编号',
  `index_desc` varchar(100) DEFAULT NULL COMMENT '索引描述',
  `column_id` varchar(300) DEFAULT NULL COMMENT '索引字段id',
  `column_name` varchar(200) DEFAULT NULL COMMENT '索引字段',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `table_id` varchar(32) DEFAULT NULL COMMENT 'table_id',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '记录标识',
  PRIMARY KEY (`index_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

/*Data for the table `tool_table_index` */

/*Table structure for table `tool_timer` */

DROP TABLE IF EXISTS `tool_timer`;

CREATE TABLE `tool_timer` (
  `timer_id` varchar(32) NOT NULL COMMENT '主键id',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `timer_no` varchar(40) DEFAULT NULL COMMENT '定时器编号',
  `timer_name` varchar(80) DEFAULT NULL COMMENT '定时器名称',
  `auditing` varchar(10) DEFAULT NULL COMMENT '状态',
  `timer_schedule` varchar(200) DEFAULT NULL COMMENT '定时策略',
  `server_first` varchar(200) DEFAULT NULL COMMENT '首选执行服务器ip',
  `server_ips` varchar(200) DEFAULT NULL COMMENT '备选执行服务器ip',
  `last_time` datetime DEFAULT NULL COMMENT '上次执行时间',
  `run_time` datetime DEFAULT NULL COMMENT '下次执行时间',
  `timeout_num` int(11) DEFAULT NULL COMMENT '超时时间(分钟)',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  `period_num` int(11) DEFAULT NULL COMMENT '周期数',
  `timer_period` varchar(200) DEFAULT NULL COMMENT '周期类型',
  `db_source` varchar(60) DEFAULT NULL COMMENT '数据源',
  PRIMARY KEY (`timer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定时计划表';

