/*Table structure for table `tool_timer_log` */

DROP TABLE IF EXISTS `tool_timer_log`;

CREATE TABLE `tool_timer_log` (
  `log_content` text COMMENT '日志内容',
  `log_id` varchar(32) NOT NULL COMMENT '主键id',
  `occur_date` datetime DEFAULT NULL COMMENT '发生时间',
  `timer_id` varchar(32) DEFAULT NULL COMMENT 'timer_id',
  `timer_no` varchar(20) DEFAULT NULL COMMENT '定时器编号',
  `timer_name` varchar(80) DEFAULT NULL COMMENT '定时器名称',
  `is_success` varchar(10) DEFAULT NULL COMMENT '执行状态',
  `source_ip` varchar(40) DEFAULT NULL COMMENT '执行ip',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`log_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定时计划日志';

/*Data for the table `tool_timer_log` */

/*Table structure for table `tool_timer_task` */

DROP TABLE IF EXISTS `tool_timer_task`;

CREATE TABLE `tool_timer_task` (
  `task_id` varchar(32) NOT NULL COMMENT '主键id',
  `timer_id` varchar(32) DEFAULT NULL COMMENT 'timer_id',
  `task_type` varchar(10) DEFAULT NULL COMMENT '任务类型',
  `is_transaction` varchar(10) DEFAULT NULL COMMENT '事务控制?',
  `task_name` varchar(80) DEFAULT NULL COMMENT '任务名称',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `service_id` varchar(32) DEFAULT NULL COMMENT '模型服务id',
  `service_name` varchar(80) DEFAULT NULL COMMENT '模型服务名称',
  `request_parames` varchar(400) DEFAULT NULL COMMENT '传入参数',
  `exec_sql` text COMMENT '执行SQL',
  `exec_class` varchar(400) DEFAULT NULL COMMENT '执行Class',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`task_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定时计划表任务明细';

