/*Table structure for table `tool_workflow` */

DROP TABLE IF EXISTS `tool_workflow`;

CREATE TABLE `tool_workflow` (
  `wf_id` varchar(32) NOT NULL COMMENT '主键id',
  `wf_name` varchar(80) DEFAULT NULL COMMENT '流程名称',
  `wf_code` varchar(60) DEFAULT NULL COMMENT '流程编号',
  `wf_type` varchar(10) DEFAULT NULL COMMENT '流程类型',
  `wf_state` varchar(10) DEFAULT NULL COMMENT '状态',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `module_id` varchar(32) DEFAULT NULL COMMENT '模块id',
  `fun_id` varchar(32) DEFAULT NULL COMMENT '功能id',
  `wf_map` text COMMENT '流程图',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`wf_id`)
